window.bookSummaryJSON = "In addition to presenting Sean Stephenson's unbelievable life story, <i>Get Off Your \"But\"</i> offers anyone who needs to conquer fears and insecurities a hands-on guide for overcoming the forces of negativity and self-sabotage. Sean - a successful psychotherapist - shows what it takes to overcome the big bumps in the road, eliminate excuses, end insecurities, and ultimately stand up for happiness and success in life. <p>As Sean explains, anyone can fall victim to the \"Buts\": <br></p> <li>\"But\" Fears (BUT what if I fail...) <br></li> <li>\"But\" Insecurities (BUT I'm not good enough...) <br></li> <li>\"But\" Excuses (BUT there's no time...)<p>Get Off Your \"But\" offers a practical guide for putting fear behind you and building the inner resources to become self-confident at work and at home. It's time to get off your \"but\" and start leading the life you dream.</p></li>"; 
